import React, {useEffect} from 'react';
import {useParams} from "react-router-dom";
import Axios from 'axios';
const User = () => {
    let {id} = useParams();
    useEffect(() => {
Axios.get()
    }, [])
    return (
        <div>
            {id}
        </div>
    );
};

export default User;
